import React from 'react';


const News = () => {
    return(
        <div>
            <section itemscope itemtype="http://schema.org/Organization">
                <h1><span itemprop="name">Mal.org company</span></h1>
                <p><span itemprop="email">mal@gmail.com</span></p>
            </section>
            <iframe width="560" height="315" src="https://www.youtube.com/embed/5X5ZLWdAnt4" frameBorder="0"
                    allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture"
                    allowFullScreen></iframe>
        </div>
    )
}


export default News;
